        _this.userThirdLinesAreaMaritime = res.data.userThirdLinesAreaMaritime;
        _this.userThirdLinesAreaAir = res.data.userThirdLinesAreaAir;
        _this.roOpenMaritimeAndInlad = res.data.roOpenMaritimeAndInlad;
        _this.roPendingMaritimeAndInlad = res.data.roPendingMaritimeAndInlad;
        _this.roClosedMaritimeAndInlad = res.data.roClosedMaritimeAndInlad;
        _this.roOpenAir = res.data.roOpenAir;
