        _this.roClosedAir = res.data.roClosedAir;
        _this.OpenRoDirector = res.data.OpenRoDirector;
        _this.OpenRoBossOperations = res.data.OpenRoBossOperations;
        _this.OpenRoMaritime = res.data.OpenRoMaritime;
        _this.OpenRoAir = res.data.OpenRoAir;
        _this.OpenRoSalesM = res.data.OpenRoSalesM;
        _this.OpenRoInland = res.data.OpenRoInland;
        _this.openRoAirOperation = res.data.openRoAirOperation;
        _this.openRoMaritimeOperation = res.data.openRoMaritimeOperation;
        _this.openRoSalesEx = res.data.openRoSalesEx;
        _this.openRoSalesM = res.data.openRoSalesM;
        _this.closeRoDirector = res.data.closeRoDirector;
        _this.closeRoBossOperations = res.data.closeRoBossOperations;
        _this.closeRoMaritime = res.data.closeRoMaritime;
        _this.closeRoAir = res.data.closeRoAir;
        _this.closeRoSales = res.data.closeRoSales;
        _this.closeRoSalesMm = res.data.closeRoSalesMm;
        _this.closeRoInland = res.data.closeRoInland;
        _this.closeRoAirOperation = res.data.closeRoAirOperation;
        _this.closeRoMaritimeOperation = res.data.closeRoMaritimeOperation;
        _this.closeRoSalesEx = res.data.closeRoSalesEx;
        _this.closeRoSalesM = res.data.closeRoSalesM;
      });
    },
    showUser: function showUser() {
      var _this2 = this;

      var url = dominio.url + "/api/mostar-usuario-autentificado";
      axios.get(url).then(function (res) {
        _this2.showUserAuth = res.data.showUserAuth;
      });
    }
  }
};

