import { dominio } from "../dominio.js";
export default {
  created() {
    this.showLineUsers();
    this.showUser();
  },
  data() {
    return {
      colorx: "#ff5000",
      userFirstLine: {},
      userSecondLine: {},
      userSecondLines: {},
      userThirdLines: {},
      userThirdLine: {},
      userThirdLinesAreaMaritime: {},
      userThirdLinesAreaAir: {},
      activePrompt: false,
      roPendingAdmin: {},
      roCloseAdmin: {},
      user: {},
      countRoAdmin: {},
      rosUserId: {},
      showUserAuth: [],
      roOpenMaritimeAndInlad: [],
      roPendingMaritimeAndInlad: [],
      roClosedMaritimeAndInlad: [],
      roOpenAir: [],
      roPendingAir: [],
      roClosedAir: [],
      OpenRoDirector: [],
      OpenRoBossOperations: [],
      OpenRoMaritime: [],
      OpenRoAir: [],
      OpenRoSalesM: [],
      OpenRoInland: [],
      openRoAirOperation: [],
      openRoMaritimeOperation: [],
      openRoSalesEx: [],
